import React from "react";
import { sidebarName } from "./constant";

export const SideBar = () => {
  return (
    <div>
      <div className="w-[300px] h-screen border-r-[0.05px] border-[#c79427]">
        {sidebarName?.map((i) => (
          <>
            <div className="w-[100%] h-[100px] border-b-[0.05px] border-[#c79427] mb-2">
              <div className="w-[100%] flex text-center">
                <p>{i.name}</p>
                <img src={i.img} alt="" />
              </div>
            </div>
          </>
        ))}
      </div>
    </div>
  );
};
